import React, { useEffect, useState } from "react";
import axios from "axios";
const Test = () => {
  const [user, setUser] = useState([]);
  useEffect(() => {
    axios
      .get(`https://jsonplaceholder.typicode.com/users`)
      .then((data) => {
        setUser(data.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
    console.log(user);

  return (
    <div>
      {user.map((data) => {
        <div>h{data.name}</div>;
      })}
    </div>
  );
};

export default Test;
